CREATE TABLE site_monitoring_report (id SERIAL PRIMARY KEY, project_id INT NOT NULL, page_id INT NOT NULL, conn_time BIGINT NOT NULL, server_time BIGINT NOT NULL, response_time BIGINT NOT NULL, total_time BIGINT NOT NULL, artificial_neural_network INT NOT NULL, content_size INT NOT NULL, lines_count INT NOT NULL, seo INT NOT NULL, created_at TIMESTAMP NOT NULL DEFAULT NOW());


